pub enum WebSocketVersion {

    /// The version of WebSocket defined in RFC6455
    WebSocket13,

    /// An unknown version of WebSocket
    Unknown(String),
}

pub enum WebSocketOtherError {

    /// A WebSocket protocol error
    ProtocolError(&'static str),

    /// Invalid WebSocket request error
    RequestError(&'static str),

    /// Invalid WebSocket response error
    ResponseError(&'static str),

    /// Received unexpected status code
    StatusCodeError(StatusCode),

    /// An HTTP parsing error
    HttpError(HttpError),

    /// A URL parsing error
    UrlError(ParseError),

    /// An input/output error
    IoError(io::Error),

    /// A WebSocket URL error
    WebSocketUrlError(WSUrlErrorKind),

    /// An SSL error
    #[cfg(any(feature = "sync-ssl", feature = "async-ssl"))]
    TlsError(TlsError),

    /// an ssl handshake failure
    #[cfg(any(feature = "sync-ssl", feature = "async-ssl"))]
    TlsHandshakeFailure,

    /// an ssl handshake interruption
    #[cfg(any(feature = "sync-ssl", feature = "async-ssl"))]
    TlsHandshakeInterruption,
}

pub enum WSUrlErrorKind {

    /// Fragments are not valid in a WebSocket URL
    CannotSetFragment,

    /// The scheme provided is invalid for a WebSocket
    InvalidScheme,

    /// There is no hostname or IP address to connect to
    NoHostName,
}

pub enum HttpCodecError {

    /// An error that occurs during the writing or reading of HTTP data
    /// from a socket.
    Io(io::Error),

    /// An error that occurs during the parsing of an HTTP request or response.
    Http(hyper::Error),
}

pub enum HyperIntoWsError {

    /// The HTTP method in a valid websocket upgrade request must be GET
    MethodNotGet,

    /// Currently HTTP 2 is not supported
    UnsupportedHttpVersion,

    /// Currently only WebSocket13 is supported (RFC6455)
    UnsupportedWebsocketVersion,

    /// A websocket upgrade request must contain a key
    NoSecWsKeyHeader,

    /// A websocket upgrade request must ask to upgrade to a `websocket`
    NoWsUpgradeHeader,

    /// A websocket upgrade request must contain an `Upgrade` header
    NoUpgradeHeader,

    /// A websocket upgrade request's `Connection` header must be `Upgrade`
    NoWsConnectionHeader,

    /// A websocket upgrade request must contain a `Connection` header
    NoConnectionHeader,

    /// IO error from reading the underlying socket
    Io(io::Error),

    /// Error while parsing an incoming request
    Parsing(::hyper::error::Error),
}
